import { signInWithGoogle } from '../services/firebase';
import Button from 'react-bootstrap/Button';
import '../css/App.css';

const Login = (props) => {
  return (
    <div className="login">
      <div style={{height: "40vw", position: "relative"}}>
        <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", transform: "translate(-50%, -50%)"}}>
          <Button variant="outline-secondary" onClick={signInWithGoogle}>Sign in with Google</Button>
        </div>
      </div>
    </div>
  )
}

export default Login;
